import { FC } from 'react';
import cn from 'classnames';
import styles from './icons.module.css';
import {
    UpVector,
    DownVector,
    CheckVector,
    ProfileVector,
    RateVector,
    CameraVector,
    BookVector,
} from './vectors';

export interface IconsProps {
    className: string;
    vectors: string[];
}

const Icons: FC<IconsProps> = ({ className, vectors }) => {
    console.log(vectors);
    return (
        <div className={cn(className, styles.container)}>
            {vectors.map(vector => get(vector))}
        </div>
    );
};

const get = (vector: string) => {
    if (vector === 'up') {
        return <UpVector className={styles.icon} />;
    }
    if (vector === 'down') {
        return <UpVector className={styles.icon} />;
    }
    if (vector === 'check') {
        return <CheckVector className={styles.icon} />;
    }
    if (vector === 'user') {
        return <ProfileVector className={styles.icon} />;
    }
    if (vector === 'rate') {
        return <RateVector className={styles.icon} />;
    }
    if (vector === 'camera') {
        return <CameraVector className={styles.icon} />;
    }
    if (vector === 'book') {
        return <BookVector className={styles.icon} />;
    }
    return <></>;
};

export default Icons;
